USE MASTER;

CREATE DATABASE Election;

GO

USE Election;

GO

CREATE TABLE Citizen
(
	ID CHAR(11) CONSTRAINT CIT_TC_PK PRIMARY KEY CONSTRAINT TC11 CHECK (Isnumeric (ID) = 1 AND Len(ID) = 11),
	FirstName NVARCHAR(20) NOT NULL,
	SecondName NVARCHAR(20),
	LastName NVARCHAR(30) NOT NULL,
	Birthday DATE NOT NULL
);

CREATE TABLE Not_eligible_to_vote
(
	CitizenID CHAR(11) FOREIGN KEY REFERENCES Citizen(ID) ON DELETE NO ACTION,
	ID CHAR(11) CONSTRAINT NETV_TC_PK PRIMARY KEY,
	MainReason VARCHAR(100) NOT NULL,
	-- Main reason can't be null because if person is on this category, government should know the reason.
);

CREATE TABLE EligibleToVote
(
	CitizenID CHAR(11) FOREIGN KEY REFERENCES Citizen(ID) ON DELETE NO ACTION,
	ID CHAR(11) CONSTRAINT ETV_TC_PK PRIMARY KEY
); --ÖNEMLİ, ID VE CITIZENID AYNI ATANMALI
CREATE TABLE Election
(
	ID INT PRIMARY KEY IDENTITY (1, 1),
	ElectionType VARCHAR(30) NOT NULL,
	ElectionDate DATE NOT NULL,
	ParticipationRate DECIMAL(5,2)
);

CREATE TABLE PoliticalParty
(
	ID VARCHAR(3) PRIMARY KEY,
	PartyName NVARCHAR(30) NOT NULL,
	FoundationDate DATE NOT NULL
);

CREATE TABLE Region
(
	ID INT PRIMARY KEY IDENTITY (1, 1),
	RegionName NVARCHAR(20) NOT NULL
);

CREATE TABLE City
(
	ID INT PRIMARY KEY IDENTITY (1, 1),
	CityName NVARCHAR(20) NOT NULL,
	RegionID INT FOREIGN KEY REFERENCES Region(ID) ON DELETE SET NULL
);

--region silindiginde digerlerine bir sey olmayacak
CREATE TABLE Candidate
(
	EligibleToVoteID CHAR(11) FOREIGN KEY REFERENCES EligibleToVote(ID) ON DELETE NO ACTION,
	ID CHAR(11) CONSTRAINT CAND_TC_PK PRIMARY KEY,--TC_ID
	ElectionID INT NOT NULL,
	PartyID VARCHAR(3) NOT NULL,
	CityID INT NOT NULL,
	FOREIGN KEY (ElectionID) REFERENCES Election(ID) ON DELETE NO ACTION,
	FOREIGN KEY (PartyID) REFERENCES PoliticalParty(ID) ON DELETE NO ACTION,
	FOREIGN KEY (CityID) REFERENCES City(ID) ON DELETE NO ACTION
);

CREATE TABLE Ballot_box
(
	ID INT PRIMARY KEY IDENTITY(1, 1),
	VoterCount INT NOT NULL,
	VoteCount INT NOT NULL,
	CityID INT NOT NULL,
	FOREIGN KEY (CityID) REFERENCES City(ID) ON DELETE NO ACTION
);

CREATE TABLE DeputyMayor
(
	EligibleToVoteID CHAR(11) FOREIGN KEY REFERENCES EligibleToVote(ID) ON DELETE NO ACTION,
	ID CHAR(11) CONSTRAINT DM_PK_TC PRIMARY KEY,
	PartyID VARCHAR(3),
	CandidateID CHAR(11) UNIQUE,
	FOREIGN KEY (PartyID) REFERENCES PoliticalParty(ID) ON DELETE NO ACTION,
	FOREIGN KEY (CandidateID) REFERENCES Candidate(ID) ON DELETE NO ACTION
);

CREATE TABLE Voter
(
	EligibleToVoteID CHAR(11) FOREIGN KEY REFERENCES EligibleToVote(ID) ON DELETE NO ACTION,
	ID CHAR(11) CONSTRAINT VOTER_PK_TC PRIMARY KEY,
	VoterPassword VARCHAR(20) NOT NULL,
	-- Voter_password is unique since it is reserved word.
	HasVoted BIT DEFAULT 0 NOT NULL,
	-- Has_voted is default 0 since it will be changed when voter votes.
	VoteTimestamp DATETIME DEFAULT NULL,
	-- NOT TIMESTAMP SINCE TIMESTAMP VALUES CANNOT BE NULL ON DEFAULT
	BoxID INT NULL FOREIGN KEY REFERENCES Ballot_box(ID) ON DELETE SET NULL
);

CREATE TABLE Vote
(
	ID INT PRIMARY KEY IDENTITY (1, 1),
	-- AUTO INCREMENTS THE FUNCTION
	ElectionID INT NOT NULL,
	VoterID CHAR(11) NOT NULL,
	CandidateID CHAR(11) NOT NULL,
	BoxID INT NOT NULL
		FOREIGN KEY (ElectionID) REFERENCES Election(ID) ON DELETE CASCADE,
	FOREIGN KEY (VoterID) REFERENCES Voter(ID) ON DELETE NO ACTION,
	FOREIGN KEY (CandidateID) REFERENCES Candidate(ID) ON DELETE NO ACTION,
	FOREIGN KEY (BoxID) REFERENCES Ballot_box(ID) ON DELETE NO ACTION,
	CONSTRAINT EID_TC_UNIQUE UNIQUE (VoterID, ElectionID)
	-- ensures that every voter votes just 1 time in 1 election.
);

CREATE TABLE PartyVotes
(
	ID INT PRIMARY KEY IDENTITY (1, 1),
	ElectionID INT NOT NULL,
	BoxID INT NOT NULL,
	PartyID VARCHAR(3) NOT NULL,
	VoteCount INT NOT NULL,
	UNIQUE (ElectionID, BoxID, PartyID),
	FOREIGN KEY (ElectionID) REFERENCES Election(ID) ON DELETE NO ACTION,
	FOREIGN KEY (PartyID) REFERENCES PoliticalParty(ID) ON DELETE NO ACTION,
	FOREIGN KEY (BoxID) REFERENCES Ballot_box(ID) ON DELETE NO ACTION
);

CREATE TABLE Result
(
	ID INT PRIMARY KEY IDENTITY(1, 1),
	ElectionID INT NOT NULL,
	PartyID VARCHAR(3) NOT NULL,
	VoteCount INT,
	CityID INT NOT NULL,
	UNIQUE (ElectionID, PartyID, CityID),
	FOREIGN KEY (ElectionID) REFERENCES Election(ID) ON DELETE CASCADE,
	FOREIGN KEY (PartyID) REFERENCES PoliticalParty(ID) ON DELETE CASCADE,
	FOREIGN KEY (CityID) REFERENCES City(ID) ON DELETE CASCADE
);

GO

-- CHECKS IS SOMEONE IN ELIGIBLE_TO_VOTE IN NOT_ELIGIBLE_TO_VOTE
CREATE TRIGGER TRG_CHECK_NOT_ELIGIBLE_TO_VOTE
	ON Not_eligible_to_vote
	FOR INSERT
	AS
BEGIN
	IF (SELECT Count(*)
	    FROM EligibleToVote
	    WHERE ID IN (SELECT ID
	                 FROM Inserted)) > 0
		BEGIN
			RAISERROR('The tc_id is already eligible to vote, cannot insert.',16,1 );

			-- If some error occurs, the value will not be inserted.
			RETURN;
		END
END;

GO

--CHECKS IF SOMEONE HAS_VOTED = 1, BUT THEIR TIMESTAMP IS NULL;
CREATE TRIGGER TRG_CHECK_VOTER_CONSTRAINTS
	ON Voter
	AFTER INSERT, UPDATE
	AS
BEGIN
	IF (SELECT Count(*)
	    FROM Inserted
	    WHERE ( HasVoted = 0
		    AND VoteTimestamp IS NOT NULL )
		   OR ( HasVoted = 1
		    AND VoteTimestamp IS NULL )) > 0
		BEGIN
			RAISERROR( 'Invalid data: has_voted and vote_timestamp values do not match the constraints.',16,2);
		END;
END;

GO

CREATE TRIGGER TRG_BALLOT_BOX_CONSISTENCY
	ON Ballot_box
	AFTER INSERT, UPDATE
	AS
BEGIN
	IF (SELECT Count(*)
	    FROM Ballot_box
	    WHERE VoterCount < VoteCount) > 0
		BEGIN
			RAISERROR('vote_count cannot exceed voter_count.',16,3);

			RETURN;
		END
END;

GO

-- Trigger to set Votercount and VoteCount in BallotBox
CREATE TRIGGER TRG_UPDATEVOTERCOUNT
	ON Voter
	AFTER INSERT, DELETE
	AS
BEGIN
	IF EXISTS (SELECT *
	           FROM inserted)
		BEGIN
			UPDATE Ballot_box
			SET VoterCount = VoterCount + 1
			FROM Ballot_box b
				     INNER JOIN inserted i
				                ON b.ID = i.BoxID;
		END

	IF EXISTS (SELECT *
	           FROM deleted)
		BEGIN
			UPDATE Ballot_box
			SET VoterCount = VoterCount - 1
			FROM Ballot_box b
				     INNER JOIN deleted d
				                ON b.ID = d.BoxID;
		END
END;

GO

CREATE TRIGGER TRG_UPDATEVOTECOUNT
	ON Vote
	AFTER INSERT, DELETE
	AS
BEGIN
	IF EXISTS (SELECT *
	           FROM inserted)
		BEGIN
			UPDATE Ballot_box
			SET VoteCount = VoteCount + 1
			FROM Ballot_box b
				     INNER JOIN inserted i
				                ON b.ID = i.BoxID;
		END

	IF EXISTS (SELECT *
	           FROM deleted)
		BEGIN
			UPDATE Ballot_box
			SET VoteCount = VoteCount - 1
			FROM Ballot_box b
				     INNER JOIN deleted d
				                ON b.ID = d.BoxID;
		END
END;

GO

CREATE INDEX IDX_VOTE_ELECTIONID_VOTERID
	ON VOTE (ElectionID, VoterID);

CREATE INDEX IDX_VOTE_CANDID_BOXID
	ON VOTE (CandidateID, BoxID);

CREATE INDEX IDX_RESULT_ELECTIONID_PARTYID
	ON RESULT (ElectionID, PartyID);

CREATE INDEX IDX_RESULT_CITYID
	ON RESULT(CityID);

CREATE INDEX IDX_City_CityName
	ON City (CityName); -- In CHECK_RESULT_FOR_CLUSTER_COLUMNS used.

CREATE INDEX IDX_PoliticalParty_PartyName
	ON PoliticalParty (PartyName); -- In CHECK_RESULT_FOR_CLUSTER_COLUMNS used.

GO


CREATE VIEW GENERAL_RESULT_VIEW
AS
SELECT p.ID,Count(*) AS TotalVoteCount
FROM   PoliticalParty p
	       INNER JOIN Candidate c
	                  ON p.ID = c.PartyID
	       INNER JOIN Vote v
	                  ON v.CandidateID = c.ID
GROUP  BY p.ID;

GO

CREATE VIEW CHECK_RESULT_FOR_CLUSTER_COLUMNS
AS
SELECT c.CityName, p.PartyName, r.VoteCount
FROM City c
	     INNER JOIN Result r ON c.ID = r.CityID
	     INNER JOIN PoliticalParty p ON p.ID = r.PartyID
group by c.CityName, p.PartyName, r.VoteCount;


