-- Updates, in order to ensure that ID's are set.
UPDATE Voter
SET EligibleToVoteID = ID;

UPDATE deputymayor
SET EligibleToVoteID = ID;

UPDATE Not_eligible_to_vote
SET CitizenID = ID;

GO

CREATE PROCEDURE GetVoterInformation @VoterID CHAR(11) -- Uygulamada VoterPage'de solda bilgileri göstersin diye kullandık
AS
BEGIN
	SELECT CONCAT(c.FirstName, ' ', ISNULL(c.SecondName, ''), ' ', c.LastName)
		       AS FullName,
	       c.Birthday,
	       v.BoxID
		       AS
	              BallotBoxID,
	       city.CityName
		       AS
	              CityName
	FROM   Voter v
		       INNER JOIN Citizen c
		                  ON v.ID = c.ID
		       INNER JOIN Ballot_box bb
		                  ON v.BoxID = bb.ID
		       INNER JOIN City city
		                  ON bb.CityID = city.ID
	WHERE  v.ID = @VoterID;
END;

-- Example: EXEC GetVoterInformation @VoterID = '50954210942';
GO

CREATE PROCEDURE GetCandidatesByCity @VoterID CHAR(11) -- VotingPage'de kullandık.
AS
BEGIN
	SELECT c.ID                AS CandidateID,
	       ci.FirstName + ' ' + ISNULL(ci.SecondName, '')
		       + ' ' + ci.LastName AS CandidateName,
	       p.PartyName
	FROM   Voter v
		       INNER JOIN Ballot_box bb
		                  ON v.BoxID = bb.ID
		       INNER JOIN Candidate c
		                  ON bb.CityID = c.CityID
		       INNER JOIN Citizen ci
		                  ON c.ID = ci.ID
		       INNER JOIN PoliticalParty p
		                  ON c.PartyID = p.ID
	WHERE  v.ID = @VoterID;
END;

GO

--Example: EXEC GetCandidatesWithDeputyByCity @VoterID = '50954210942';
CREATE PROCEDURE GetCandidatesWithDeputyByCity @VoterID CHAR(11) -- CandidateDetails pageinde kullandık
AS
BEGIN
	SELECT c.ID                                              AS CandidateID,
	       ci.FirstName + ' ' + ISNULL(ci.SecondName, '')
		       + ' ' + ci.LastName                               AS CandidateName,
	       p.PartyName,
	       dm.ID                                             AS DeputyMayorID,
	       dci.FirstName + ' '
		       + ISNULL(dci.SecondName, '') + ' ' + dci.LastName AS
		       DeputyMayorName
	FROM   Voter v
		       INNER JOIN Ballot_box bb
		                  ON v.BoxID = bb.ID
		       INNER JOIN Candidate c
		                  ON bb.CityID = c.CityID
		       INNER JOIN Citizen ci
		                  ON c.ID = ci.ID
		       INNER JOIN PoliticalParty p
		                  ON c.PartyID = p.ID
		       LEFT JOIN DeputyMayor dm
		                 ON c.ID = dm.CandidateID
		       LEFT JOIN Citizen dci
		                 ON dm.ID = dci.ID
	WHERE  v.ID = @VoterID;
END;

